<p>\xA0\xA0\xA0\xA0 \u8FD9\u91CC\u53EA\u6F14\u793A\u6309\u94AE\u7684\u9AD8\u4EAE\u548C\u975E\u9AD8\u4EAE\u72B6\u6001\u5207\u6362\uFF0C\u5728lua\u811A\u672C\u7F16\u8F91\u7A97\u53E3\u7684onload\u548Ctouch_up\u4E8B\u4EF6\u9009\u9879\u5185\u5206\u522B\u6DFB\u52A0\u5982\u4E0B\u4EE3\u7801\uFF1A</p>
